import React from "react";
import "../Styles/seed.css";

export default function Btn(props) {
  const { text, className, children } = props;

  return (
    <>
      <div
        className={` ${className} h-pr-fl-ma w-a min-h-25  p-10px h-e c-p  b-s-b-b ns-c-f-1 c-p h-e hover-underline-animation`} Style="border: 1px solid; border-color: white;"
      >     <a href="" className="w-a h-a h-pr-fl-ma ">
        <div
          className="w-a h-a h-pr-fl-ma t-a-c r-v-c c-white "
          Style="font-size: 15px; line-height: 20px;"
        >
            <span className="r-v-c">
            {text}
            </span>
        </div>  </a>
      </div>
    </>
  );
}
